#include <unordered_map>
#include <sstream>
#include <iostream>
#include <vector>
using namespace std;

class Solution {
public:
    bool mapdelN(unordered_map<char, int>& cs,
                const vector<string>& ns,
                int N) {
        for(char c : ns[N]) {
            if (cs.find(c) == cs.end())
                return false;
        }
		for (char c : ns[N]) {
			cs[c] --;
			if (cs[c] == 0) {
				cs.erase(c);
			}
		}
        return true;
    }

    void mapaddN(unordered_map<char, int>& cs,
                const vector<string>& ns,
                int N) {
        for (char c : ns[N]) {
            cs[c]++;
        }
    }

    bool dfs(unordered_map<char, int>& cs,
             const vector<string>& ns,
             int N,
             vector<int>& ret) {

        for (int n=N; n<10; n++) {
            if (!mapdelN(cs, ns, n))
                continue;
            ret.push_back(n);
            if (dfs(cs, ns, n, ret))
                return true;
            ret.pop_back();
            mapaddN(cs, ns, n);
        }

        return cs.empty();
    }
    string originalDigitsV1(string s) {
        vector<string> ns = {"zero",
                            "one",
                            "two",
                            "three",
                            "four",
                            "five",
                            "six",
                            "seven",
                            "eight",
                            "nine"};
        unordered_map<char, int> cs;
        for (char c : s) {
            cs[c]++;
        }
        vector<int> ret;

        dfs(cs, ns, 0, ret);

		stringstream result;
		std::copy(ret.begin(), ret.end(), std::ostream_iterator<int>(result, " "));
        return result.str();
    }
	string originalDigits(string s) {
		vector<string> ns = {"zero",
                            "one",
                            "two",
                            "three",
                            "four",
                            "five",
                            "six",
                            "seven",
                            "eight",
                            "nine"};
        unordered_map<char, int> cs;
		vector<int> nums = {0,2,4,6,8,1,3,5,7,9};
		string dchar = "zwuxgorfvi";
        for (char c : s) {
            cs[c]++;
        }

		string ret;
		for (int i = 0; i < 10; ++i) {
			int count =cs[dchar[i]];
			for (char c : ns[nums[i]]) {
				cs[c] -= count;
			}

			while (count!=0) {
				ret.append(to_string(nums[i]));
				count --;
			}
		}

		sort(ret.begin(), ret.end());
		return ret;
	}
};

